В настоящее время известны следующие типы пневматического оружия:
Духовые трубки, в которых метание снаряда производится силой легких стрелка;
Пружинно-поршневая пневматика, в которой сжатый воздух для метания пули образуется непосредственно в момент выстрела за счет движения внутри цилиндра массивного поршня, разгоняемого разжимающейся пружиной: 
Электропневматическое оружие — в котором сжатие боевой пружины осуществляется за счет энергии, запасенной в аккумуляторной батарее;
Газобаллонная пневматика, в которой для метания пуль используется газообразная фаза углекислоты (СО2): 
со встроенным перезаправляемым резервуаром;
со сменным баллоном;
Компрессионная пневматика, в которой сжатый воздух для метания пули высвобождается в момент выстрела из специальной накопительной камеры. Воздух в накопительную камеру нагнетается перед каждым выстрелом при помощи расположенного на оружии ручного насоса: 
Компрессионная — с однократной ручной накачкой (взводом);
Мультикомпрессионная — с многократной ручной накачкой;
Пневматика с предварительной накачкой или Пневмобаллонная пневматика, в которой сжатый воздух для выстрела дозируется из расположенного на оружии резервуара, заправка баллона сжатым воздухом осуществляется от внешних источников: ручных либо электрических компрессоров высокого давления, баллонов со сжатым воздухом, гелием;
Пневматическое оружие на пневмопатронах, в котором используются специальные многоразовые патроны, заправляемые сжатым воздухом. Конструктивно оружие на пневмопатронах сходно с огнестрельным, существуют специальные наборы для приспособления огнестрельного оружия под пневмопатроны с целью удешевления тренировок с ним и развлекательной стрельбы.
Пневмоэлектрическое оружие, которое дополнительно содержит горючий элемент, расположенный с возможностью контакта со сжатым газом, и при выстреле сгорающий в сжатом газе .
